import React, { useState, useRef } from 'react';
import { processVideo, queryVideo } from './api';

const App = () => {
  const [url, setUrl] = useState('');
  const [query, setQuery] = useState('');
  const [message, setMessage] = useState('');
  const [results, setResults] = useState([]);
  const [isLoading, setIsLoading] = useState(false);
  const [currentClip, setCurrentClip] = useState(null);
  const videoRef = useRef(null);

  const handleProcess = async () => {
    setIsLoading(true);
    setMessage('');
    try {
      const data = await processVideo(url);
      setMessage(data.message || data.error);
    } catch (error) {
      setMessage('Error processing video');
    }
    setIsLoading(false);
  };

  const handleQuery = async () => {
    setIsLoading(true);
    setResults([]);
    try {
      const data = await queryVideo(query);
      setResults(data);
    } catch (error) {
      setMessage('Error querying video');
    }
    setIsLoading(false);
  };

  const playClip = (startTime, endTime) => {
    setCurrentClip({ startTime, endTime });
    if (videoRef.current) {
      videoRef.current.currentTime = parseTimeToSeconds(startTime);
      videoRef.current.play();
    }
  };

  const parseTimeToSeconds = (timeString) => {
    const [minutes, seconds] = timeString.split(':').map(Number);
    return minutes * 60 + seconds;
  };

  return (
    <div className="container mx-auto p-4">
      <h1 className="text-2xl font-bold mb-4">Video Processing and Querying</h1>

      <div className="mb-4">
        <input
          type="text"
          placeholder="Enter YouTube URL"
          value={url}
          onChange={(e) => setUrl(e.target.value)}
          className="w-full p-2 border rounded mb-2"
        />
        <button 
          onClick={handleProcess} 
          disabled={isLoading}
          className="bg-blue-500 text-white px-4 py-2 rounded disabled:bg-gray-400"
        >
          Process Video
        </button>
      </div>

      {message && <div className="mb-4 p-4 bg-yellow-100 border-l-4 border-yellow-500">{message}</div>}

      <div className="mb-4">
        <input
          type="text"
          placeholder="Enter query"
          value={query}
          onChange={(e) => setQuery(e.target.value)}
          className="w-full p-2 border rounded mb-2"
        />
        <button 
          onClick={handleQuery} 
          disabled={isLoading}
          className="bg-green-500 text-white px-4 py-2 rounded disabled:bg-gray-400"
        >
          Query Video
        </button>
      </div>

      {results.length > 0 && (
        <div className="mb-4">
          <h2 className="text-xl font-semibold mb-2">Results:</h2>
          {results.map((result, index) => (
            <div key={index} className="mb-4 p-4 border rounded">
              <p><strong>Time:</strong> {result.start_time} - {result.end_time}</p>
              <p><strong>Description:</strong> {result.description}</p>
              <p><strong>Score:</strong> {result.score.toFixed(4)}</p>
              <button 
                onClick={() => playClip(result.start_time, result.end_time)}
                className="mt-2 bg-purple-500 text-white px-4 py-2 rounded"
              >
                Play Clip
              </button>
            </div>
          ))}
        </div>
      )}

      {currentClip && (
        <div className="mb-4">
          <h2 className="text-xl font-semibold mb-2">Current Clip:</h2>
          <video 
            ref={videoRef}
            controls 
            className="w-full"
            onTimeUpdate={() => {
              if (videoRef.current && videoRef.current.currentTime >= parseTimeToSeconds(currentClip.endTime)) {
                videoRef.current.pause();
              }
            }}
          >
            <source src={url} type="video/mp4" />
            Your browser does not support the video tag.
          </video>
        </div>
      )}
    </div>
  );
};

export default App;
